import React, { Component } from 'react'
import './News.css'

export default class News extends Component {
    render() {
        return (

            <div>

                <table className="table" border="1">
                    <th>ประชาสัมพันธ์</th>
                    <tr>
                        <td>ข่าว1</td>
                        <td>ข่าว2</td>
                        <td>ข่าว3</td>
                        <td>ข่าว4</td>
                        <td>ข่าว5</td>
                    </tr>
                </table>

            </div>
        )
    }
}
